import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import HomePage from '../src/components/home';



function App() {
  return (
    <div className="App">
      <Switch>
     <Route path="/">
      <HomePage/>
     </Route>
     <Route path="/pokemons">

     </Route>


      </Switch>
    </div>
  );
}

export default App;
